import React , {useEffect,useState } from 'react';

import { getProducts } from './helper/Coreapicalls';
import Base from './Base';
import Card from './Card';
import "../styles.css";
import Catagory from './Catagory';



export default function Home() {

  const [products,setProducts]=useState([]);
  const [error,setError]=useState(false);


  const loadallProducts = () => {
    getProducts()
      .then((data) => {
        if (data && data.error) {
          setError(data.error);
          console.log(error);
        } else {
          
          setProducts(data);
        }
      });
  };

  useEffect(() => {
		loadallProducts();
	}, []);

  return (
    <Base>

        <div className='container-fluid mx-2'>
          <div className='row'>
              
                
              
                    <Catagory product={products.catagory}/>
                    
                
              
          

          <div className='col-md-10'>
            <div className='row'>
            
      

      {products.map((product,index)=>
      
      {
        return (
          
          
          <div key={index} className="col-3 mb-3">  
              <Card product={product}/>
            
              <br>
              </br>
              <br>
              </br>
            </div>
        )
      })}
    
            </div>

          </div>
          </div>
          <div className="container">
        <div className="card">
          <div className="card-header">
            <img src="https://c0.wallpaperflare.com/preview/483/210/436/car-green-4x4-jeep.jpg" alt="rover" />
          </div>
          <div className="card-body">
            <span className="tag tag-teal">Technology</span>
            <h4>
              Why is the Tesla Cybertruck designed the way it
              is?
            </h4>
            <p>
              An exploration into the truck's polarising design
            </p>
            <div className="user">
              <img src="https://yt3.ggpht.com/a/AGF-l7-0J1G0Ue0mcZMw-99kMeVuBmRxiPjyvIYONg=s900-c-k-c0xffffffff-no-rj-mo" alt="user" />
              <div className="user-info">
                <h5>July Dec</h5>
                <small>2h ago</small>
              </div>
            </div>
          </div>
        </div>
        <div className="card">
          <div className="card-header">
            <img src="https://www.newsbtc.com/wp-content/uploads/2020/06/mesut-kaya-LcCdl__-kO0-unsplash-scaled.jpg" alt="ballons" />
          </div>
          <div className="card-body">
            <span className="tag tag-purple">Popular</span>
            <h4>
              How to Keep Going When You Don’t Know What’s Next
            </h4>
            <p>
              The future can be scary, but there are ways to
              deal with that fear.
            </p>
            <div className="user">
              <img src="https://lh3.googleusercontent.com/ogw/ADGmqu8sn9zF15pW59JIYiLgx3PQ3EyZLFp5Zqao906l=s32-c-mo" alt="user" />
              <div className="user-info">
                <h5>Eyup Ucmaz</h5>
                <small>Yesterday</small>
              </div>
            </div>
          </div>
        </div>
        <div className="card">
          <div className="card-header">
            <img src="https://images6.alphacoders.com/312/thumb-1920-312773.jpg" alt="city" />
          </div>
          <div className="card-body">
            <span className="tag tag-pink">Design</span>
            <h4>
              10 Rules of Dashboard Design
            </h4>
            <p>
              Dashboard Design Guidelines
            </p>
            <div className="user">
              <img src="https://studyinbaltics.ee/wp-content/uploads/2020/03/3799Ffxy.jpg" alt="user" />
              <div className="user-info">
                <h5>Carrie Brewer</h5>
                <small>1w ago</small>
              </div>
            </div>
          </div>
        </div>
      </div>
          </div>
          
        
       

      
 
     
      
     
      
      
    </Base>
  ); 
}
